{
  "openapi": "3.0.1",
  "info": {
    "title": "PetPartners Core Api",
    "version": "v1"
  },
  "servers": [
    {
      "url": "/core"
    }
  ],
  "paths": {
    "/v1/MarketChannel": {
      "get": {
        "tags": [
          "MarketChannel"
        ],
        "summary": "Gets market channel information",
        "parameters": [
          {
            "name": "hostname",
            "in": "query",
            "schema": {
              "type": "string",
              "nullable": true
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Successfully gets market channel information",
            "content": {
              "text/plain": {
                "schema": {
                  "$ref": "#/components/schemas/MarketChannelDTO"
                }
              },
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/MarketChannelDTO"
                }
              },
              "text/json": {
                "schema": {
                  "$ref": "#/components/schemas/MarketChannelDTO"
                }
              }
            }
          },
          "204": {
            "description": "No market channel information found"
          },
          "400": {
            "description": "Exception thrown",
            "content": {
              "text/plain": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              },
              "application/json": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              },
              "text/json": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              }
            }
          }
        }
      }
    },
    "/v1/Search/receiving": {
      "get": {
        "tags": [
          "Search"
        ],
        "summary": "Gets a list of search results for the receiving tool",
        "responses": {
          "200": {
            "description": "Successfully retrieved a list of search results for the receiving tool",
            "content": {
              "text/plain": {
                "schema": {
                  "type": "array",
                  "items": {
                    "$ref": "#/components/schemas/ReceivingSearchResultDTO"
                  },
                  "nullable": true
                }
              },
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "$ref": "#/components/schemas/ReceivingSearchResultDTO"
                  },
                  "nullable": true
                }
              },
              "text/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "$ref": "#/components/schemas/ReceivingSearchResultDTO"
                  },
                  "nullable": true
                }
              }
            }
          },
          "400": {
            "description": "Error occurred",
            "content": {
              "text/plain": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              },
              "application/json": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              },
              "text/json": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              }
            }
          },
          "403": {
            "description": "User unauthorized to perform this action",
            "content": {
              "text/plain": {
                "schema": {
                  "$ref": "#/components/schemas/ProblemDetails"
                }
              },
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ProblemDetails"
                }
              },
              "text/json": {
                "schema": {
                  "$ref": "#/components/schemas/ProblemDetails"
                }
              }
            }
          }
        }
      }
    },
    "/v1/Underwriter": {
      "get": {
        "tags": [
          "Underwriter"
        ],
        "summary": "Gets a list of active UnderwriterDTOs",
        "responses": {
          "200": {
            "description": "Successfully retrieved a list of active UnderwriterDTOs"
          },
          "400": {
            "description": "Error occurred",
            "content": {
              "text/plain": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              },
              "application/json": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              },
              "text/json": {
                "schema": {
                  "type": "string",
                  "nullable": true
                }
              }
            }
          }
        }
      }
    }
  },
  "components": {
    "schemas": {
      "MarketChannelDTO": {
        "type": "object",
        "properties": {
          "marketChannelId": {
            "type": "integer",
            "format": "int32"
          },
          "code": {
            "type": "string",
            "nullable": true
          },
          "display": {
            "type": "string",
            "nullable": true
          },
          "trialEligibleDays": {
            "type": "integer",
            "format": "int32"
          },
          "termsAndConditions": {
            "type": "string",
            "nullable": true
          },
          "active": {
            "type": "boolean",
            "nullable": true
          },
          "createdOn": {
            "type": "string",
            "format": "date-time"
          },
          "mcName": {
            "type": "string",
            "nullable": true
          },
          "phoneNo": {
            "type": "string",
            "nullable": true
          },
          "website": {
            "type": "string",
            "nullable": true
          },
          "emailFromName": {
            "type": "string",
            "nullable": true
          },
          "emailFromAddress": {
            "type": "string",
            "nullable": true
          }
        },
        "nullable": true
      },
      "CustomerSearchResultDTO": {
        "type": "object",
        "properties": {
          "firstName": {
            "type": "string",
            "nullable": true
          },
          "lastName": {
            "type": "string",
            "nullable": true
          },
          "address1": {
            "type": "string",
            "nullable": true
          },
          "address2": {
            "type": "string",
            "nullable": true
          },
          "city": {
            "type": "string",
            "nullable": true
          },
          "stateCode": {
            "type": "string",
            "nullable": true
          },
          "postalCode": {
            "type": "string",
            "nullable": true
          },
          "isPrimary": {
            "type": "boolean"
          }
        },
        "nullable": true
      },
      "PetSearchResultDTO": {
        "type": "object",
        "properties": {
          "petId": {
            "type": "integer",
            "format": "int32"
          },
          "registeredName": {
            "type": "string",
            "nullable": true
          },
          "callName": {
            "type": "string",
            "nullable": true
          },
          "breedDisplay": {
            "type": "string",
            "nullable": true
          },
          "dateOfBirth": {
            "type": "string",
            "format": "date-time"
          },
          "isDeceased": {
            "type": "boolean"
          }
        },
        "nullable": true
      },
      "ClaimSearchResultDTO": {
        "type": "object",
        "properties": {
          "claimId": {
            "type": "integer",
            "format": "int32"
          },
          "receivedOn": {
            "type": "string",
            "format": "date-time",
            "nullable": true
          },
          "processedOn": {
            "type": "string",
            "format": "date-time",
            "nullable": true
          },
          "claimStatusId": {
            "type": "integer",
            "format": "int32"
          },
          "statusDisplay": {
            "type": "string",
            "nullable": true
          }
        },
        "nullable": true
      },
      "ReceivingSearchResultDTO": {
        "type": "object",
        "properties": {
          "policyId": {
            "type": "integer",
            "format": "int32"
          },
          "policyStatusDisplay": {
            "type": "string",
            "nullable": true
          },
          "policyEffectiveOn": {
            "type": "string",
            "format": "date-time"
          },
          "policyExpiresOn": {
            "type": "string",
            "format": "date-time"
          },
          "customers": {
            "type": "array",
            "items": {
              "$ref": "#/components/schemas/CustomerSearchResultDTO"
            },
            "nullable": true
          },
          "pets": {
            "type": "array",
            "items": {
              "$ref": "#/components/schemas/PetSearchResultDTO"
            },
            "nullable": true
          },
          "claims": {
            "type": "array",
            "items": {
              "$ref": "#/components/schemas/ClaimSearchResultDTO"
            },
            "nullable": true
          }
        },
        "nullable": true
      },
      "Object": {
        "type": "object",
        "nullable": true
      },
      "ProblemDetails": {
        "type": "object",
        "properties": {
          "type": {
            "type": "string",
            "nullable": true
          },
          "title": {
            "type": "string",
            "nullable": true
          },
          "status": {
            "type": "integer",
            "format": "int32",
            "nullable": true
          },
          "detail": {
            "type": "string",
            "nullable": true
          },
          "instance": {
            "type": "string",
            "nullable": true
          },
          "extensions": {
            "type": "object",
            "additionalProperties": {
              "$ref": "#/components/schemas/Object"
            },
            "nullable": true,
            "readOnly": true
          }
        },
        "additionalProperties": {
          "$ref": "#/components/schemas/Object"
        },
        "nullable": true
      }
    }
  }
}
